Teaser:
Run your C/C++ programs in ChATGPT using this prompt. This is a very powerful prompt to run all kinds of coding languages directly in your web browser using Chatgpt.

 Just type in your C or C++ code you want to run in the prompt and Chat-GPT will give you the output of that program in response.

 This is useful if you don't have compiler installed in your PC and want to test some code now you can do it by simple prompt.

 Example for C++ code.
 #include <Istream>

 int main() {
  std::cout << "Hello chat-gpt3" << std::endl;
  return 0;
 }
